  {
    id: "m1",
    name: "Sushi",
    description: "Finest fish and veggies",
    price: 22.99,
  },
  {
    id: "m2",
    name: "Schnitzel",
    description: "A german specialty!",
    price: 16.5,
  },
  {
    id: "m3",
    name: "Barbecue Burger",
    description: "American, raw, meaty",
    price: 12.99,
  },
  {
    id: "m4",
    name: "Green Bowl",
    description: "Healthy...and green...",
    price: 18.99,
  },
];
const MealsAvailable = () => {
  const mealName = DUMMY_MEALS.map((meal) => meal.name)
  const mealDescription = DUMMY_MEALS.map((meal) => meal.description)
  const mealPrice = DUMMY_MEALS.map((meal) => meal.price)
  const mealId = DUMMY_MEALS.map((meal) => meal.id)

  return (
    <MealCart className={classes.meals}>
      <ul key={meal.id}>
          <li >{meal.name}</li>
    
      </ul>
    </MealCart>
  );
};

export default MealsAvailable;
